import React from 'react';
import Idea from './Idea';

function IdeaList () {

  const [ideas, deleteIdea, editIdea] = useState([]) 

  return (
    <div>
      {ideas && ideas.map((idea) => {
        return(

        <Idea

          key={idea.id} 
          idea={idea} 
          deleteIdea={deleteIdea} 
          editIdea={editIdea}
          />

        );
      })}
    </div>
  );
};


export default IdeaList;
